class RocketParent extends React.Component {
	render() {
		console.log(this.props.rockets);
		for (let key in this.props.rockets){
			console.log(key);
		}

		const array = Array(4).fill('TEST');
		console.log(array);

		return (
			<div>
				{array.map(array2 => (
					<p>{array2}</p>
				))}
			</div>
		);
	};
};

function Rocket() {

};

